<!DOCTYPE html>

<html lang="en"><head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>Animal Sticker Grid</title>
<!-- Tailwind CSS CDN with plugins -->
<script src="https://cdn.tailwindcss.com?plugins=forms,container-queries"></script>
<!-- BEGIN: CustomStyles -->
<!-- 
    While Tailwind handles most styling, we use this block for specific custom background
    and precise gradient definitions that might be verbose in utility classes.
  -->
<style data-purpose="background-styles">
    body {
      /* Dark warm brown gradient */
      background: linear-gradient(180deg, #4a2c25 0%, #2e1a15 100%);
      min-height: 100vh;
      margin: 0;
      display: flex;
      justify-content: center;
      align-items: center;
    }
  </style>
<style data-purpose="avatar-styles">
    /* 
      Ensures the avatars maintain a specific aspect ratio or behavior 
      if not fully covered by Tailwind utilities. 
    */
    .avatar img {
      display: block;
      width: 100%;
      height: 100%;
      object-fit: cover;
      transition: transform 0.2s ease-in-out;
    }
    
    /* Adds a subtle pop effect on hover/active states for interactivity */
    .avatar:hover img {
      transform: scale(1.05);
    }
  </style>
<!-- END: CustomStyles -->
<style>
    body {
      min-height: max(884px, 100dvh);
    }
  </style>
  </head>
<body class="text-white">
<!-- BEGIN: MainContainer -->
<!-- 
    Main wrapper centered on the screen. 
    Using flexbox (via body styles) to center this container vertically and horizontally.
    'w-full max-w-sm' ensures it looks good on mobile but doesn't stretch too wide on larger screens.
  -->
<main class="w-full max-w-[360px] p-6" data-purpose="grid-container">
<!-- Title for context (optional but good for semantics) -->
<!-- BEGIN: AnimalGrid -->
<!-- 
      3x3 Grid Layout
      - grid-cols-3: Creates 3 columns.
      - gap-[15px]: Sets the requested gap between items.
    -->
<div class="grid grid-cols-3 gap-[20px]" data-purpose="sticker-grid">
